import React from "react";
import Hash from "../components/Hash";

function GamePage({ word }) {
  console.log(word);
  return (
    <div>
      {word.map((x, i) => (
        <Hash leter={x} key={i} />
      ))}
    </div>
  );
}

export default GamePage;
